import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import React, { useState } from 'react';
import {Button} from 'react-bootstrap'

function App() {

  const [two, setTwo] = useState(true)
  const [three, setThree] = useState(true)
  const [four, setFour] = useState(true)
  const [five, setFive] = useState(true)
  const [six, setSix] = useState(true)
  const [seven, setSeven] = useState(true)
  const [eight, setEight] = useState(true)
  const [nine, setNine] = useState(true)
  const [ten, setTen] = useState(true)
  const [eleven, setEleven] = useState(true)
  const [twelve, setTwelve] = useState(true)


  return (
    <div>
        <Button variant="secondary" size="lg">2</Button>
        <Button variant="secondary" size="lg">3</Button>
        <Button variant="secondary" size="lg">4</Button>
        <Button variant="secondary" size="lg">5</Button>
        <Button variant="secondary" size="lg">6</Button>
        <Button variant="secondary" size="lg">7</Button>
        <Button variant="secondary" size="lg">8</Button>
        <Button variant="secondary" size="lg">9</Button>
        <Button variant="secondary" size="lg">10</Button>
        <Button variant="secondary" size="lg">11</Button>
        <Button variant="secondary" size="lg">12</Button>
    </div>
  );
}

export default App;
